declare module 'react' {
  import React from 'react';
  export const ComponentProps: any;
  export const ComponentType: any;
  export const DependencyList: any;
  export const FC: any;
  export const ReactElement: any;
  export const ReactNode: any;
  export function cloneElement(element: React.ReactElement<any>, props?: any): React.ReactElement<any>;
  export function createElement(type: string | React.ComponentType<any>, props?: any, children?: React.ReactNode): React.ReactElement<any>;
  export function isValidElement(object: any): boolean;
  export function useCallback(callback: (...args: any[]) => void, deps?: any[]): any;
  export function useEffect(effect: () => void, deps?: any[]): void;
  export function useMemo(factory: () => any, deps?: any[]): any;
  export function useRef<T>(initialValue: T): React.MutableRefObject<T>;
  export function useState<S>(initialState: S): [S, React.Dispatch<React.SetStateAction<S>>];
}

declare module 'react-native-gesture-handler' {
  import * as React from 'react';
  export const defaultExport: any;
}

declare module 'react-native-reanimated' {
  import * as React from 'react';
  export const FlatList: any;
  export const ScrollEvent: any;
  export const Text: any;
  export const View: any;
  export function runOnJS(fn: (...args: any[]) => void): void;
  export function useAnimatedScrollHandler(options?: any): any;
  export function useAnimatedStyle(style: any, dependencies?: any[]): any;
  export function useSharedValue(value: number): React.SharedValue<number>;
  export function withTiming(value: number, options?: any): Promise<void>;
}
